<div class="containers" onclick="toggleSidebar()" style={{marginRight: "10px", marginLeft: "20px"}}>
  <br/>

  <ul class="sidenav">
    <li><a data-toggle="tab" href="#menu0" class="glyphicon glyphicon-home">Dashboard</a></li>
    <li class="active">
                        <a data-toggle="tab" href="#menu1" class="glyphicon glyphicon-user">Create-Role</a></li>
                        <li><a data-toggle="tab" href="#menu2" class="glyphicon glyphicon-list">Manage-Users</a></li>
                        <li><a data-toggle="tab" href="#menu3" class="glyphicon glyphicon-list-alt">Reconcile</a></li>
                        <li><a data-toggle="tab" href="#menu4" class="glyphicon glyphicon-briefcase">Upload</a></li>
                        <li><a data-toggle="tab" href="#menu5" class="glyphicon glyphicon-tasks">User-Management</a></li>
                        <li><a data-toggle="tab" href="#menu6" class="glyphicon glyphicon-transfer">Warehouse-Management</a></li>
                        <li><a href="login.html"><i class="glyphicon glyphicon-log-out"aria-hidden="true"></i>Logout</a></li>

 </ul>
      </div>
    </div>
    );
  }
}


export default App;
